  name: GlobalQueuedThreadBase<TAsynchronousHandlerProcessor, TAsynchronousArgument>
  nameWithType: GlobalQueuedThreadBase<TAsynchronousHandlerProcessor, TAsynchronousArgument>
  fullName: SuperOffice.Threading.GlobalQueuedThreadBase<TAsynchronousHandlerProcessor, TAsynchronousArgument>
  type: Class
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: >-
    This class provides a queue implementation for the queued asynchronous execution

    strategy, that gives us one single queue for the whole NetServer instance.   See remarks

    for important information on execution context!

    <remarks>

    *** NOTE *** on Context: The AsyncContext that is associated with the executing thread is based on the

    context of the thread that started it. Since this is not predictable, and may change (if the queue empties),

    you CANNOT ASSUME that the execution context for any unit of work is that of the calling (client) thread!

    <p></p>

    Therefore, this execution model should only be used if the context is not relevant - that may not be so often.

    </remarks>
